import React, { Component } from 'react';

class FooterComponent extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }
    render() {
        return (
            <div>
                <footer className="footer">

                <span className="text-muted">All right Reserved 2021@Talukder</span>
                </footer>
                
            </div>
        );
    }
}

export default FooterComponent;
